import { IProduct } from '../models/IProducts';

export const getCategories = (products: IProduct[]) => {
  return products
    .map(product => product.bsr_category)
    .reduce<string[]>((acc, current) => {
      if (!acc.includes(current)) {
        acc.push(current);
      }

      return acc;
    }, []);
};
